using HECSFramework.Core;namespace Strategies{	[Documentation(Doc.Strategy, Doc.HECS, "this node concate two strings")]	public class CombineString : GenericNode<string>	{		[Connection(ConnectionPointType.In, "<string> A")]		public GenericNode<string> A;		[Connection(ConnectionPointType.In, "<string> B")]		public GenericNode<string> B;		[Connection(ConnectionPointType.Out, "<string> Out")]		public BaseDecisionNode Out;		public override string TitleOfNode { get; } = "CombineString";		public override void Execute(Entity entity)		{		}		public override string Value(Entity entity)		{			return A.Value(entity) + B.Value(entity);		}	}}